package ar.edu.unju.edm.modelo;

public class Equipo {
	private String nombre;
	private int dni;
	
	
	public Equipo() {
			// TODO Auto-generated constructor stub
		}


	public String getNombre() {
		return nombre;
	}


	public void setNombre(String nombre) {
		this.nombre = nombre;
	}


	public int getDni() {
		return dni;
	}


	public void setDni(int dni) {
		this.dni = dni;
	}

	
}
